import React, { useEffect, useState } from "react";
import axios from 'axios';
import { Map, Marker, GoogleApiWrapper } from "google-maps-react";

const MapContainer = () => {
  let url = "https://earthquake.usgs.gov/earthquakes/feed/v1.0/summary/significant_month.geojson"
  const [data, setData] = useState([])

  async function fetchEarthquakes() {
    const response = await axios.get(url);
    console.log("storyresponse", response)
    setData(response.data.features)
    console.log("story", data);
}

  useEffect(() => {
    fetchEarthquakes()
  }, [])
    return (
      <div className="mapContainer">
        <Map
          initialCenter={{ lat: 37.78, lng: -122.44 }}
          style={{
            width: "44%",
            height: "45%",
            left: "-4rem",
            top: "-3.6rem"
          }}
          zoom={1}
        >
          data.map((quake, index) => (
      <Marker
        key={data.properties.time}
        title={data.properties.place}
        name={data.properties.place}
        position={{
          lat: data.geometry.coordinates[1],
          lng: data.geometry.coordinates[0]
        }}
      />
    ));
        </Map>
      </div>
    );
}

// must export apiKey?
export default GoogleApiWrapper({
  apiKey: "AIzaSyDIrnzXxTpkpUpqVagW4TLsMSjVyUQTmfY"
})(MapContainer);
